import React, { useState } from 'react';
import './App.css'; // ייבוא קובץ ה-CSS

const App = () => {
    const [xMin, setXMin] = useState('');
    const [xMax, setXMax] = useState('');
    const [yMin, setYMin] = useState('');
    const [yMax, setYMax] = useState('');
    const [numPoints, setNumPoints] = useState('');
    const [timeMin, setTimeMin] = useState('');
    const [timeMax, setTimeMax] = useState('');

    const [data, setData] = useState([]); // נתונים לדינמיות
    const [loading, setLoading] = useState(false);

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log({ xMin, xMax, yMin, yMax, numPoints, timeMin, timeMax });
        // כאן תוכל לקרוא ל-BACKEND ולקבל נתונים
        fetchData();
    };

    const fetchData = async () => {
        setLoading(true);
        // דוגמת קריאה ל-BACKEND (שנה את ה-URL בהתאם)
        const response = await fetch('https://your-backend-api-url.com/data');
        const result = await response.json();
        setData(result);
        setLoading(false);
    };

    return (
        <div className="app-container">
            <h1>RGraph</h1>

            {/* קונטיינר אופקי לאזורים */}
            <div className="horizontal-container">
                {/* אזור קלט */}
                <div className="input-container">
                    <h2>Input Values</h2>
                    <form onSubmit={handleSubmit}>
                        <div className="input-group">
                            <label>X Range:</label>
                            <input type="number" placeholder="MIN" value={xMin} onChange={(e) => setXMin(e.target.value)} />
                            <input type="number" placeholder="MAX" value={xMax} onChange={(e) => setXMax(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Y Range:</label>
                            <input type="number" placeholder="MIN" value={yMin} onChange={(e) => setYMin(e.target.value)} />
                            <input type="number" placeholder="MAX" value={yMax} onChange={(e) => setYMax(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Number of Points:</label>
                            <input type="number" value={numPoints} onChange={(e) => setNumPoints(e.target.value)} />
                        </div>
                        <div className="input-group">
                            <label>Time Range (seconds):</label>
                            <input type="number" placeholder="MIN" value={timeMin} onChange={(e) => setTimeMin(e.target.value)} />
                            <input type="number" placeholder="MAX" value={timeMax} onChange={(e) => setTimeMax(e.target.value)} />
                        </div>
                        <button type="submit">Submit</button>
                    </form>
                </div>

                {/* טבלת נתונים */}
                <div className="data-table-container">
                    <h2>Data Table</h2>
                    {loading ? (
                        <p>Loading data...</p>
                    ) : (
                        <table className="data-table">
                            <thead>
                                <tr>
                                    <th>X</th>
                                    <th>Y</th>
                                    <th>Seconds</th> {/* עמודה חדשה לשניות */}
                                </tr>
                            </thead>
                            <tbody>
                                {data.map((item, index) => (
                                    <tr key={index}>
                                        <td>{item.x}</td>
                                        <td>{item.y}</td>
                                        <td>{item.seconds}</td> {/* ערך עבור עמודת השניות */}
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    )}
                </div>

                {/* גרף */}
                <div className="chart-container">
                    <h2>Graph</h2>
                    <p>Your graph will be displayed here.</p>
                </div>
            </div>
        </div>
    );
};

export default App;
